/****************************************************************************
* Ãû³Æ£ºGUI_LoadLine()
* ¹¦ÄÜ£ºÊä³öµ¥É«Í¼ÐÎµÄÒ»ÐÐÊý¾Ý¡£
* Èë¿Ú²ÎÊý£º x		Ö¸¶¨ÏÔÊ¾Î»ÖÃ£¬x×ø±ê
*           y		Ö¸¶¨ÏÔÊ¾Î»ÖÃ£¬y×ø±ê
*           dat		ÒªÊä³öÏÔÊ¾µÄÊý¾Ý¡£
*           no      ÒªÏÔÊ¾´ËÐÐµÄµã¸öÊý
* ³ö¿Ú²ÎÊý£º·µ»ØÖµÎª1Ê±±íÊ¾²Ù×÷³É¹¦£¬Îª0Ê±±íÊ¾²Ù×÷Ê§°Ü¡£
* ËµÃ÷£º²Ù×÷Ê§°ÜÔ­ÒòÊÇÖ¸¶¨µØÖ·³¬³öÓÐÐ§·¶Î§¡£
****************************************************************************/
uint8  GUI_LoadLine(uint32 x, uint32 y, uint8 *dat, uint32 no)
{  uint8   bit_dat;
   uint8   i;
   TCOLOR  bakc;

   bit_dat	= 0;
   /* ²ÎÊý¹ýÂË */
   if(x>=GUI_LCM_XMAX) return(0);
   if(y>=GUI_LCM_YMAX) return(0);
   
   for(i=0; i<no; i++)
   {  /* ÅÐ¶ÏÊÇ·ñÒª¶ÁÈ¡µãÕóÊý¾Ý */
      if( (i%8)==0 ) bit_dat = *dat++;
     
      /* ÉèÖÃÏàÓ¦µÄµãÎªcolor»òÎªback_color */
      if( (bit_dat&DCB2HEX_TAB[i&0x07])==0 ) GUI_CopyColor(&bakc, back_color); 
         else  GUI_CopyColor(&bakc, disp_color);
      GUI_Point(x, y, bakc);       
     
      if( (++x)>=GUI_LCM_XMAX ) return(0);
   }
   
   return(1);
}
