/****************************************************************************
* Ãû³Æ£ºGUI_HZ
* ¹¦ÄÜ£ºÏÔÊ¾ºº×Ö´®£¨16*16ËÎÌå£©¡£
* Èë¿Ú²ÎÊý£º x		Ö¸¶¨ÏÔÊ¾Î»ÖÃ£¬x×ø±ê
*           y		Ö¸¶¨ÏÔÊ¾Î»ÖÃ£¬y×ø±ê
*           str		ºº×Ö×Ö·û´®¡£
* ³ö¿Ú²ÎÊý£ºÎÞ
* ËµÃ÷£º
****************************************************************************/
void GUI_HZ(uint32 x, uint32 y, char *str)
{	int i=0;
	int p;
	while(1)
	{
		if(*(str+i)=='\0')break;
		if(*(str+i)<0x80)
		{

		   GUI_PutString8_16A(x,y ,*(str+i));
		   x+=8;
		   i++;

		}
		else
		{
			p=(int)((*(str+i)) <<8)+(int)(*(str+i+1))-(*(str+i)-0xb0)*0xa2-0xb0a1;
			
#if FONTLIBCLIPPING > 0		//¼ô²Ã×Ö¿â£¬ÐèÒª¶Ô×Ö¿â½øÐÐË÷Òý
			p	= ClippingIndex[p];
			if (p >= 0)
				GUI_PutHZ(x,y,(uint8*)(hanzi+p*32),16,16);
#else	//·ñÔò£¬Ê¹ÓÃÍêÈ«×Ö¿â
			GUI_PutHZ(x,y,(uint8*)(hanzi+p*32),16,16);
#endif			
			x+=16;
			i+=2;
		}
	}	
}

void GUI_hz(uint32 x, uint32 y, char p1,char p2)
{
	int p;
	p=((p1 <<8)+p2)-(p1-0xb0)*0xa2-0xb0a1;
	
#if FONTLIBCLIPPING > 0		//¼ô²Ã×Ö¿â£¬ÐèÒª¶Ô×Ö¿â½øÐÐË÷Òý
	p	= ClippingIndex[p];
	if (p >= 0)
		GUI_PutHZ(x,y,(uint8*)(hanzi+p*32),16,16);
#else	//·ñÔò£¬Ê¹ÓÃÍêÈ«×Ö¿â
	p=((p1 <<8)+p2)-(p1-0xb0)*0xa2-0xb0a1;
	GUI_PutHZ(x,y,(uint8*)(hanzi+p*32),16,16);
#endif			
			
}
/****************************************************************************
* Ãû³Æ£ºGUI_PutString8_16
* ¹¦ÄÜ£ºÏÔÊ¾£¨8*16£©¡£
* Èë¿Ú²ÎÊý£º x		Ö¸¶¨ÏÔÊ¾Î»ÖÃ£¬x×ø±ê
*           y		Ö¸¶¨ÏÔÊ¾Î»ÖÃ£¬y×ø±ê
*           str		ºº×Ö×Ö·û´®¡£
* ³ö¿Ú²ÎÊý£ºÎÞ
* ËµÃ÷£º
****************************************************************************/
void GUI_PutString8_16(uint32 x, uint32 y, char *str)
{	int i=0;
	int p;
	while(1)
	{
		if(*(str+i)=='\0')break;
		p=(int)*(str+i)-0x20;
		GUI_PutHZ(x,y,(uint8*)(char8_16+p*16),8,16);
		x+=8;
		i++;
	}
		
}
void GUI_PutString8_16A(uint32 x, uint32 y, char str)
{
	int p;
		p=str-0x20;
		GUI_PutHZ(x,y,(uint8*)(char8_16+p*16),8,16);

}
